import React, { Component } from 'react';
import styles from './resumeList.module.scss';

export default ({ experienceSource }) => {
    return <div>
        <ul>
            {
                experienceSource && experienceSource.map(item => 
                    <li key={item.id}>
                        <div>{item.time}</div>
                    </li>
                )
            }
        </ul>
    </div>
}
